Минский стартап WANNABY (<http://wanna.by>) ищет CV инженера в R&amp;D команду.

Мы пилим мобильные приложения для примерки в AR для e-commerce. Выпустили :nail_care:, в процессе с :ring:, и еще что-то пока скрыто завесой тайны :secret: 

Ожидается, что хороший кандидат:
- может сносно писать на Python (продакшен опыт необязателен, но приветствуется);
- имеет опыт работы с OpenCV (`cv2.imread` и `cv2.imresize` недостаточно);
- умеет в Deep Learning на уровне написания :unet: без особых мысленных усилий;
- умеет прочитать статью с последнего CVPR (что-то уровня <https://arxiv.org/abs/1802.00434>) и разобраться, в чем там основная идея;
- отличает camera space от world space;
- готов поcпорить о преимуществах квартернионов над rotation matrixes (или наоборот).

Задачи сложные, атмосфера ламповая, PhD и :kaggle: мастер необязательны. :fork:: 2-3k$ + опционы.

Писать можно мне в чатике или в <mailto:arseny@wanna.by|arseny@wanna.by>.
